import React from "react";
import "./Bus.css";

const bus = props => {
  return (
    <div className="Bus">

      <p>Numer autobusu: {props.routeId} Kierunek: {props.headsign} Odjazd: {this.getEstimatedInMinutes(props.estimatedTime)}</p>


    </div>
  );
};


const getEstimatedInMinutes = (est) => {
    return "Za 8 minut";
}
export default bus;
